import React from 'react';
import About from './components/About';

const HomePage = () => {
  return (
    <>
      <About />
      <div className="container mx-auto p-6">
        <div className="text-center my-12">
          <h1 className="text-5xl font-bold mb-4">Welcome to My Portfolio</h1>
          <img
            src="path/to/your/picture.jpg"
            alt="Iuliia Obukhova"
            className="rounded-full mx-auto w-100 h-100 mb-4 border-4 border-gray-800"
          />
          <p className="text-lg mb-8">
            Hello, I'm <span className="font-semibold">Iuliia Obukhova</span>, a Full Stack Web Developer specializing in Three.js. Welcome to my portfolio.
          </p>
        </div>
      </div>
    </>
  );
};

export default HomePage;
